  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this plan is to describe
  the fishery resource of Lake Drummond and present a management scheme which best
  uses these resources to achieve the goals of the National Wildlife Refuge System
  and Great Dismal Swamp National Wildlife Refuge. The following are the broad goals
  of fishery management:  1) Maintain and improve the quality of aquatic habitats
  for a well-balanced community of fish and other water oriented wildlife species,
  2) Provide compatible quality recreational fishing opportunities with primary refuge
  objectives.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
